webpackJsonp([0x7bfa3c8d1abd],{410:function(A,a){A.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="sunset"\n        title=""\n        src="/static/sunset-f0a9c7118a853922b629699a2aca813e-631b1.jpg"\n        srcset="/static/sunset-f0a9c7118a853922b629699a2aca813e-30fbd.jpg 200w,\n/static/sunset-f0a9c7118a853922b629699a2aca813e-e87dc.jpg 400w,\n/static/sunset-f0a9c7118a853922b629699a2aca813e-631b1.jpg 800w,\n/static/sunset-f0a9c7118a853922b629699a2aca813e-300e3.jpg 1200w,\n/static/sunset-f0a9c7118a853922b629699a2aca813e-c15ef.jpg 1600w,\n/static/sunset-f0a9c7118a853922b629699a2aca813e-3a622.jpg 2400w,\n/static/sunset-f0a9c7118a853922b629699a2aca813e-646e8.jpg 4160w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Sunset over Ocean Beach on my first night</h4>\n<p>For the next 10 weeks I\'ll be living in San Francisco while I intern at <a href="https://www.braintreepayments.com/?partner_source=US_DT_SEA_GGL_TXT_RES_DEV_CPC_GW_YBR&#x26;gclid=CIqqk53tidQCFRZLDQod6CUE4w&#x26;gclsrc=aw.ds&#x26;dclid=CPjquJ3tidQCFc9ANwodoGIGTg">Braintree</a>.</p>\n<p>In the days leading up to my departure I began to feel the rush of anxiety and excitement that comes with moving across the country to start a new job.</p>\n<p>This summer marks two important firsts for me: living in a city, and my first job working as a (kinda) professional software developer.</p>\n<p>Naturally, I spent the last few days prior to my departure frantically searching for blog posts from past interns trying to figure out what the heck I\'ve gotten myself into.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 128.590021691974%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Oakland Bridge from above"\n        title=""\n        src="/static/plane-278038a75fb85479f10546f11e8f6843-631b1.jpg"\n        srcset="/static/plane-278038a75fb85479f10546f11e8f6843-30fbd.jpg 200w,\n/static/plane-278038a75fb85479f10546f11e8f6843-e87dc.jpg 400w,\n/static/plane-278038a75fb85479f10546f11e8f6843-631b1.jpg 800w,\n/static/plane-278038a75fb85479f10546f11e8f6843-300e3.jpg 1200w,\n/static/plane-278038a75fb85479f10546f11e8f6843-c15ef.jpg 1600w,\n/static/plane-278038a75fb85479f10546f11e8f6843-429a6.jpg 2305w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Passing over Sierra Nevada</h4>\n<p>Surprisingly, I found very little.  As a result, I have decided to document my experiences over the next ten weeks.  Hopefully my writing can serve as a healthy mix of entertainment as well as source of useful information.</p>\n<h2>Housing</h2>\n<p>If you\'re not aware of how crazy the housing market is in SF right now, I\'m here to clear that up.  I spent hours over christmas break searching through listings on <a href="https://www.padmapper.com/">Padmapper</a>, <a href="https://www.craigslist.org/about/sites">Craigslist</a>, &#x26; <a href="https://www.airbnb.com/">Airbnb</a> before finding a place with one other roommate that I thought would meet my needs.</p>\n<p>Unfortunately, a few days before I left I found out that there was a slight mixup with my Airbnb and that I would be staying at a different location with more roommates than originally planned.</p>\n<p>Yikes.  I haven\'t even made it to San Fran yet, and I\'ve already made my first mistake.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="bunk bed"\n        title=""\n        src="/static/bunkbed-ca1fdd0aad8c71bb094711f4220c197e-631b1.jpg"\n        srcset="/static/bunkbed-ca1fdd0aad8c71bb094711f4220c197e-30fbd.jpg 200w,\n/static/bunkbed-ca1fdd0aad8c71bb094711f4220c197e-e87dc.jpg 400w,\n/static/bunkbed-ca1fdd0aad8c71bb094711f4220c197e-631b1.jpg 800w,\n/static/bunkbed-ca1fdd0aad8c71bb094711f4220c197e-300e3.jpg 1200w,\n/static/bunkbed-ca1fdd0aad8c71bb094711f4220c197e-c15ef.jpg 1600w,\n/static/bunkbed-ca1fdd0aad8c71bb094711f4220c197e-3a622.jpg 2400w,\n/static/bunkbed-ca1fdd0aad8c71bb094711f4220c197e-c1f12.jpg 3120w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Hopefully the most expensive bunk bed I\'ll ever pay to sleep in...</h4>\n<p>Luckily, my hosts were gracious enough to admit their mistake and offer me a slight discount.  For the sake of transparency, I\'m paying around $1100/month for a spot on a bunk bed (I even have my own bed!).</p>\n<p>On the plus side, the apartment is super nice and my hosts and roommates have been extremely welcoming so far.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title=""\n        src="/static/muffin-a64c2c19599844338878a7a91a181f6f-631b1.jpg"\n        srcset="/static/muffin-a64c2c19599844338878a7a91a181f6f-30fbd.jpg 200w,\n/static/muffin-a64c2c19599844338878a7a91a181f6f-e87dc.jpg 400w,\n/static/muffin-a64c2c19599844338878a7a91a181f6f-631b1.jpg 800w,\n/static/muffin-a64c2c19599844338878a7a91a181f6f-300e3.jpg 1200w,\n/static/muffin-a64c2c19599844338878a7a91a181f6f-c15ef.jpg 1600w,\n/static/muffin-a64c2c19599844338878a7a91a181f6f-3a622.jpg 2400w,\n/static/muffin-a64c2c19599844338878a7a91a181f6f-c1f12.jpg 3120w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Did I mention we have a balcony?</h4>\n<p>Keep in mind that I chose to work in a prime location close to downtown. If you value personal space or sharing a bathroom with 4 other people is not your idea of a good time, commuting from Oakland or somewhere further away from downtown is probably your best option.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 784px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 82.2704081632653%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alttext"\n        title=""\n        src="/static/apt-c39ac4aabfd0ba0389d75b9b34c1d90d-304dd.png"\n        srcset="/static/apt-c39ac4aabfd0ba0389d75b9b34c1d90d-e25e8.png 200w,\n/static/apt-c39ac4aabfd0ba0389d75b9b34c1d90d-a27a2.png 400w,\n/static/apt-c39ac4aabfd0ba0389d75b9b34c1d90d-304dd.png 784w"\n        sizes="(max-width: 784px) 100vw, 784px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>My new home! Trader Joe\'s is a 3 minute walk...</h4>\n<p>Is it really worth it to pay this much to live in SF?  How are you going to survive sharing a small space with so many other people?  I have no idea, but I\'ll keep you updated!</p>\n<h2>Work</h2>\n<p>I don\'t have much to report in this area considering I haven\'t started yet, but my first day of work is this Tuesday!</p>\n<p>What I do know is that I\'ll be working on the Core Disputes team.  The team is in charge of building tools that help merchants maximize their chances of winning payment dispute cases filed against them, and to help support teams that deal with fraud to work more efficiently.</p>\n<p>Realistically, I have no idea exactly what I\'ll be doing, but hopefully I\'ll have a better idea by this time next week.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 67.42565055762081%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="balcony"\n        title=""\n        src="/static/balcony-5910d9b4567629983d86724e94d391db-631b1.jpg"\n        srcset="/static/balcony-5910d9b4567629983d86724e94d391db-30fbd.jpg 200w,\n/static/balcony-5910d9b4567629983d86724e94d391db-e87dc.jpg 400w,\n/static/balcony-5910d9b4567629983d86724e94d391db-631b1.jpg 800w,\n/static/balcony-5910d9b4567629983d86724e94d391db-300e3.jpg 1200w,\n/static/balcony-5910d9b4567629983d86724e94d391db-c15ef.jpg 1600w,\n/static/balcony-5910d9b4567629983d86724e94d391db-66325.jpg 2152w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  )</p>\n<h2>Outside of work</h2>\n<p>Here\'s my (short) current bucket list of things I HAVE to do in SF this summer (hit me with suggestions that I should add if you have any).</p>\n<ul>\n<li>Bike across the golden gate bridge, have lunch in Tiburon and take the ferry back</li>\n<li>Do the audio tour of Alcatraz</li>\n<li>Swim in the Pacific Ocean</li>\n<li>Climb to the top of <a href="http://sfrecpark.org/destination/telegraph-hill-pioneer-park/coit-tower/">Coit Tower</a></li>\n<li>Walk the labyrinth at <a href="https://localwiki.org/sf/Land%27s_End_Labyrinth">Land\'s End</a></li>\n<li><del>Bonfire and Sunset on <a href="http://www.parksconservancy.org/visit/park-sites/ocean-beach.html?referrer=https://www.google.com/">Ocean Beach</a></del></li>\n</ul>\n<p></p>\n<h4>My host took me to Ocean Beach for a bonfire with friends just hours after my arrival.</h4>\n<p>I\'m also looking to buy/rent a bike while I\'m here to make getting around a little easier.  More on that to come.</p>\n<h2>Food</h2>\n<p>If you\'ve examined the ratio of food:life pictures on <a href="https://www.instagram.com/taytaytrey/">my instagram</a>, it\'s probably no surprise that I like talking about food.</p>\n<p>I\'m lucky enough to have free breakfast and lunch at Braintree during the week, but that still leaves plenty of time to explore the local food scene and do some cooking as well.  There\'s a Whole Foods, Trader Joe\'s and Safeway all fairly close to my apartment, and I\'m hoping to take advantage of the plethora of farmer\'s markets around as well.</p>\n<p>A quick search of the nearby farmer\'s markets yielded:</p>\n<ul>\n<li>Civic Center Farmer\'s Market (Wednesday and Sunday)</li>\n<li>Alemany Farmer\'s Market (Saturday)</li>\n<li>Grand Lake Farmer\'s Market in Oakland (Saturday)</li>\n<li>Stonestown Galleria (Sunday)</li>\n</ul>\n<p>Here\'s a few restaurants I\'m eying as well:</p>\n<ul>\n<li><a href="https://missionchinesefood.com/sf/">Mission Chinese Food</a></li>\n<li><a href="http://www.littlegem.restaurant/">Little Gem</a></li>\n<li><a href="http://www.littlegem.restaurant/">Vive La Tarte</a></li>\n<li><a href="https://www.facebook.com/LaTaqSF">La Taqueria</a></li>\n</ul>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 493px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 121.50101419878297%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="baked goods"\n        title=""\n        src="/static/bakedgood-f021ea838f40dd689e360883a1314b02-786c9.png"\n        srcset="/static/bakedgood-f021ea838f40dd689e360883a1314b02-4f7c0.png 200w,\n/static/bakedgood-f021ea838f40dd689e360883a1314b02-dfe41.png 400w,\n/static/bakedgood-f021ea838f40dd689e360883a1314b02-786c9.png 493w"\n        sizes="(max-width: 493px) 100vw, 493px"\n      />\n    </span>\n  </span>\n  </p>\n<h4><a href="https://www.instagram.com/vivelatarte/">Vive La Tarte</a></h4>\n<p>I\'m also hoping to experiment with home curing meat this summer.  I\'m planning on following the method outlines in <a href="https://www.youtube.com/watch?v=cEkdCgAMgpw">this</a> video.  I\'m still scouting out quality butchers nearby but I\'m pretty excited about it...hopefully my roommates won\'t mind.</p>\n<h2>Podcast</h2>\n<p>Those who know me know that I love podcasts, and naturally I\'ve always wanted to try recording my own.  Recently, one of my favorite podcasts, <a href="http://softwareengineeringdaily.com/">Software Engineering Daily</a> opened up to allow others to work with the owner to host an episode.</p>\n<p>I\'m still fleshing out a lot of the details but I\'m currently working towards recording an episode about Alexa Skill Development.  There\'s a lot more work that needs to go into this but expect to hear more in the future...unless of course work gets a little too crazy.</p>\n<h2>Interview Prep</h2>\n<p>This is the point where you might start to think I\'m a little crazy (you\'re not wrong).  If you\'re not interested in Software Engineering, feel free to skip this part.</p>\n<p>I\'m planning to spend ~5 hours a week preparing for technical interviews so that I\'m not cramming come the fall.  Besides, interview questions can be fun!</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 122.0321931589537%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="table"\n        title=""\n        src="/static/table-371b05f8d487b62ca6c67d83e3ff7e44-631b1.jpg"\n        srcset="/static/table-371b05f8d487b62ca6c67d83e3ff7e44-30fbd.jpg 200w,\n/static/table-371b05f8d487b62ca6c67d83e3ff7e44-e87dc.jpg 400w,\n/static/table-371b05f8d487b62ca6c67d83e3ff7e44-631b1.jpg 800w,\n/static/table-371b05f8d487b62ca6c67d83e3ff7e44-300e3.jpg 1200w,\n/static/table-371b05f8d487b62ca6c67d83e3ff7e44-c15ef.jpg 1600w,\n/static/table-371b05f8d487b62ca6c67d83e3ff7e44-3a622.jpg 2400w,\n/static/table-371b05f8d487b62ca6c67d83e3ff7e44-ec0d7.jpg 2982w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>My general plan is to do at least one <a href="https://www.pramp.com/#/">Pramp</a> interview per week, and then spend another four hours working my way through questions in <a href="https://www.amazon.com/Cracking-Coding-Interview-Programming-Questions/dp/0984782850/ref=pd_lpo_sbs_14_t_0?_encoding=UTF8&#x26;psc=1&#x26;refRID=VG1PWFRM79JXCBAZ2GSW">Cracking The Coding Interview</a> (CTCI) and <a href="https://leetcode.com/">Leetcode</a>.  I plan to work through CTCI until I finish it and then grind questions on Leetcode for the rest of the time.</p>\n<p>I could try to make a detailed outline of what topics I will cover when, but the truth is I wouldn\'t follow it.  I\'ll probably ramp the amount of time I spend studying up or down depending on how I\'m progressing.</p>\n<p>For more details on the strategies I\'ll be using to study, check out <a href="http://haseebq.com/how-to-break-into-tech-job-hunting-and-interviews/">this</a> fantastic article.</p>\n<hr>\n<p>That\'s all for today.  Thanks for reading and check in next Sunday to hear about my first week in San Francisco!</p>',frontmatter:{path:"/interning-in-sf-week-0",title:"Life as an intern in San Francisco (Week 0)",date:"05-28-2017",tag:"Life"}}},pathContext:{}}}});
//# sourceMappingURL=path---interning-in-sf-week-0-ff3010432d11311c315a.js.map